-- Table: System.PSPCard_Tbl
-- Translation table for identifying which cards each Payment Service Provider can process
CREATE TABLE System.PSPCard_Tbl
(
	id			SERIAL,
	cardid		INT4 NOT NULL,	-- ID of the Card the PSP can clear
	pspid		INT4 NOT NULL,	-- ID of the Payment Service Provider who can process the card

	CONSTRAINT PSPCard_PK PRIMARY KEY (id),
	CONSTRAINT PSPCard2Country_FK FOREIGN KEY (cardid) REFERENCES System.Card_Tbl ON UPDATE CASCADE ON DELETE CASCADE,
	CONSTRAINT PSPCard2PSP_FK FOREIGN KEY (pspid) REFERENCES System.PSP_Tbl ON UPDATE CASCADE ON DELETE CASCADE,
	CONSTRAINT PSPCard_UQ UNIQUE (cardid, pspid),
	LIKE Template.General_Tbl INCLUDING DEFAULTS
) WITHOUT OIDS;

CREATE TRIGGER Update_PSPCard
BEFORE UPDATE
ON System.PSPCard_Tbl FOR EACH ROW
EXECUTE PROCEDURE Public.Update_Table_Proc();

-- Internal
INSERT INTO System.PSPCard_Tbl (id, cardid, pspid, enabled) VALUES (0, 0, 0, false);
INSERT INTO System.PSPCard_Tbl (cardid, pspid) SELECT id, 1 FROM System.Card_Tbl WHERE name = 'SMS';
INSERT INTO System.PSPCard_Tbl (cardid, pspid) SELECT id, 2 FROM System.Card_Tbl WHERE name != 'SMS';

GRANT SELECT, UPDATE, INSERT, DELETE ON TABLE System.PSPCard_Tbl TO mpoint;


-- Table: SurePay_Tbl
-- Configuration table for all SurePay modules for each Client
CREATE TABLE Client.SurePay_Tbl
(
	id			SERIAL,
	clientid	INT4,	-- Client ID
	
	resend		INT4,	-- Number of Minutes elapsed before the Payment Link will be resent
	notify		INT4,	-- Number of Minutes elapsed after the Payment Link has been resent twice before Customer Service is notified
	
	email		VARCHAR(50),	-- E-Mail address to Customer Service

	CONSTRAINT SurePay_PK PRIMARY KEY (id),
	CONSTRAINT SurePay2Client_FK FOREIGN KEY (clientid) REFERENCES Client.Client_Tbl ON UPDATE CASCADE ON DELETE CASCADE,
	CONSTRAINT SurePay_UQ UNIQUE (clientid),
	LIKE Template.General_Tbl INCLUDING DEFAULTS
) WITHOUT OIDS;

CREATE TRIGGER Update_SurePay
BEFORE UPDATE
ON Client.SurePay_Tbl FOR EACH ROW
EXECUTE PROCEDURE Update_Table_Proc();

-- Internal
INSERT INTO Client.SurePay_Tbl (id, clientid, resend, notify, email) VALUES (0, 0, 0, 0, 'Internal');

GRANT SELECT, UPDATE, INSERT, DELETE ON TABLE Client.SurePay_Tbl TO mpoint;


-- Table: PricePoint_Tbl
-- Definition table for all available Price Points in a given country
-- The amount is in the smallest currency possible, i.e. cents, pence, re etc.
CREATE TABLE System.PricePoint_Tbl
(
	id			SERIAL,
	countryid	INT4,	-- Country ID
	
	amount		INT4,

	CONSTRAINT PricePoint_PK PRIMARY KEY (id),
	CONSTRAINT PricePoint2Country_FK FOREIGN KEY (countryid) REFERENCES System.Country_Tbl ON UPDATE CASCADE ON DELETE CASCADE,
	CONSTRAINT PricePoint_UQ UNIQUE (countryid, amount),
	LIKE Template.General_Tbl INCLUDING DEFAULTS
) WITHOUT OIDS;

CREATE TRIGGER Update_PricePoint
BEFORE UPDATE
ON System.PricePoint_Tbl FOR EACH ROW
EXECUTE PROCEDURE Update_Table_Proc();

