-- Table: CardPricing_Tbl
-- Definition table for defining which Price Points a Credit Card accepts.
-- This is mainly useful if billing is handled by a Mobile Network Operator who has a limited number of price points
CREATE TABLE System.CardPricing_Tbl
(
	id				SERIAL,
	pricepointid	INT4,			-- ID of Price Point
	cardid			INT4,			-- ID of Card
	
	CONSTRAINT CardPricing_PK PRIMARY KEY (id),
	CONSTRAINT CardPricing2PricePoint_FK FOREIGN KEY (pricepointid) REFERENCES System.PricePoint_Tbl ON UPDATE CASCADE ON DELETE CASCADE,
	CONSTRAINT CardPricing2Card_FK FOREIGN KEY (cardid) REFERENCES System.Card_Tbl ON UPDATE CASCADE ON DELETE CASCADE,
	CONSTRAINT CardPricing_UQ UNIQUE (pricepointid, cardid),
	LIKE Template.General_Tbl INCLUDING DEFAULTS
) WITHOUT OIDS;

CREATE TRIGGER Update_CardPricing
BEFORE UPDATE
ON System.CardPricing_Tbl FOR EACH ROW
EXECUTE PROCEDURE Update_Table_Proc();

