INSERT INTO System.CardPricing_Tbl (pricepointid, cardid) SELECT -10, id FROM System.Card_Tbl WHERE id < 10;
INSERT INTO System.CardPricing_Tbl (pricepointid, cardid) SELECT -20, id FROM System.Card_Tbl WHERE id < 10;
INSERT INTO System.CardPricing_Tbl (pricepointid, cardid) SELECT id, 10 FROM System.PricePoint_Tbl WHERE id > 0;

GRANT SELECT, UPDATE, INSERT, DELETE ON TABLE System.CardPricing_Tbl TO mpoint;

